INSERT INTO public.recipes VALUES (186, 'Mediterranean Grilled Chicken with Couscous and Vegetables', 'A flavorful and protein-rich Mediterranean dish perfect for muscle gain, featuring grilled chicken, couscous, and a variety of vegetables.', '["muscle_gain"]', '["muscle_gain", "high_protein", "mediterranean"]', '["high-protein"]', '["lunch", "dinner"]', '["Marinate the chicken: In a bowl, combine 20g olive oil, lemon juice, minced garlic, salt, and black pepper. Add the sliced chicken breast and coat well. Let it marinate for at least 15 minutes.", "While the chicken marinates, prepare the couscous: Bring 300g of water to a boil. Remove from heat, add couscous, cover, and let it sit for 5 minutes. Fluff with a fork.", "Heat a grill pan over medium-high heat and grill the marinated chicken for about 6-8 minutes per side, or until fully cooked and the internal temperature reaches 165\u00b0F (74\u00b0C).", "In a separate pan, heat the remaining olive oil (7g) and saut\u00e9 the zucchini and tomatoes for 5-7 minutes, or until softened.", "In a large bowl, combine the cooked couscous, grilled chicken, saut\u00e9ed vegetables, crumbled feta cheese, and black olives. Mix well.", "Garnish with chopped parsley and serve warm."]', 'mediterranean', 45, NULL, 'medium', 2, '{"calories": 1040.0, "protein_g": 76.0, "carbs_g": 122.0, "fat_g": 28.0, "fiber_g": 9.0}', NULL, NULL, '[-0.035552363842725754, -0.05659355968236923, 0.0011690293904393911, 0.0028835611883550882, -0.01201439369469881, 0.041314151138067245, 0.023943427950143814, 0.008653351105749607, -0.002464764751493931, -0.022492311894893646, 0.01658114418387413, -0.0728972852230072, 0.040503233671188354, 0.03849727660417557, -0.022855089977383614, 0.056252118200063705, -0.04033251479268074, 0.03420794755220413, 0.0033103604800999165, 0.005911167245358229, 0.06158710643649101, 0.01189702469855547, -0.00932022463530302, 0.004956204444169998, -0.023559309542179108, 0.016378413885831833, 0.007255584467202425, 0.0139243202283