INSERT INTO public.recipes VALUES (187, 'Mediterranean Chicken and Quinoa Bowl', 'A high-protein Mediterranean dish featuring chicken, quinoa, and a medley of vegetables, perfect for muscle gain.', '["muscle_gain"]', '["quick", "meal_prep_friendly", "high_protein"]', '["high-protein"]', '["lunch", "dinner"]', '["Cook the quinoa: Rinse the quinoa under cold water. In a pot, combine 75g of quinoa with 150ml of water. Bring to a boil, then reduce to a simmer. Cover and cook for 15 minutes or until water is absorbed. Fluff with a fork and set aside.", "Prepare the grill pan over medium heat. Season the chicken breast with salt, black pepper, and oregano. Drizzle with a little olive oil.", "Grill the chicken: Place the chicken breast on the heated grill pan. Cook for 6-7 minutes on each side until the internal temperature reaches 75\u00b0C (165\u00b0F). Let it rest for 5 minutes before slicing.", "Prepare the vegetables: Halve the cherry tomatoes, dice the cucumber, and slice the red onion. Crumble the feta cheese.", "Assemble the bowl: Place the cooked quinoa in a serving bowl. Arrange the sliced grilled chicken, cherry tomatoes, cucumber, and red onion over the quinoa.", "Drizzle with olive oil and lemon juice. Sprinkle crumbled feta cheese on top.", "Garnish with additional oregano if desired. Serve immediately."]', 'mediterranean', 45, NULL, 'medium', 1, '{"calories": 1118.0, "protein_g": 83.0, "carbs_g": 126.0, "fat_g": 31.0, "fiber_g": 12.0}', NULL, NULL, '[-0.02678786590695381, -0.03992689773440361, 0.025397492572665215, 0.033345796167850494, -0.0005326144746504724, -0.012165769934654236, 0.04286985471844673, 0.023891253396868706, -0.017379671335220337, 0.00471858074888587, 0.025652393698692322, -0.017136355862021446, 0.01731015183031559, 0.03348483145236969, 0.0029081981629133224, 0.06669159233570099, -0.022292323410511017, 0.012177355587482452, -0.015062381513416767, 0.06085202097892761, 0.07976110279560089, 0.04551156610250473, -0.009217018261551857, 0.01861942