INSERT INTO public.recipes VALUES (188, 'Mediterranean Grilled Chicken with Quinoa and Chickpeas', 'A high-protein Mediterranean-inspired dish featuring grilled chicken, quinoa, and chickpeas with a blend of spices, perfect for muscle gain.', '["muscle_gain"]', '["muscle_gain", "meal_prep_friendly", "high_protein"]', '["high-protein"]', '["lunch", "dinner"]', '["Preheat the grill to medium-high heat.", "Season the chicken breasts with salt, black pepper, cumin, and paprika, then drizzle with 13.5g (1 tbsp) of olive oil.", "Grill the chicken for about 6-7 minutes on each side, until fully cooked. Let rest before slicing.", "Rinse the quinoa under cold water, then cook it in a pot with 370 grams of water until it''s fluffy and water is absorbed.", "In a pan, heat the remaining olive oil. Add chopped onion, minced garlic, and chopped red bell pepper. Saut\u00e9 until soft.", "Add the drained chickpeas to the pan and cook for another 2-3 minutes, then mix in the cooked quinoa.", "Stir in lemon juice and chopped parsley, seasoning with additional salt and pepper to taste.", "Serve the sliced grilled chicken over the quinoa and chickpea mix, garnishing with extra parsley if desired."]', 'mediterranean', 45, NULL, 'medium', 2, '{"calories": 907.0, "protein_g": 70.0, "carbs_g": 105.0, "fat_g": 24.0, "fiber_g": 18.0}', NULL, NULL, '[-0.015275781974196434, -0.04525679349899292, 0.018548395484685898, 0.023834096267819405, -0.02056148275732994, 0.015932457521557808, 0.028786076232790947, 0.014156204648315907, -0.012982800602912903, -0.017299635335803032, -0.008843590505421162, -0.04306069761514664, 0.014231560751795769, 0.03963737189769745, -0.011572562158107758, 0.048572465777397156, -0.04413721337914467, -0.004688233602792025, -0.017988605424761772, 0.017385756596922874, 0.08000677824020386, 0.010905121453106403, -0.02570723555982113, 0.011002007871866226, -0.028010983020067215, 0.013284225016832352, 0.010759791359305382, 0.009053511545062065, 0.0281832255423069, -0.001330171