INSERT INTO public.recipes VALUES (189, 'Tandoori Chicken with Spiced Brown Rice', 'A flavorful and protein-packed Indian dish featuring tandoori-spiced grilled chicken with a side of aromatic spiced brown rice. Perfect for fitness enthusiasts focused on fat loss.', '["fat_loss"]', '["grilled", "high_protein", "meal_prep_friendly"]', '["high-protein", "gluten-free"]', '["lunch", "dinner"]', '["In a bowl, combine yogurt, lemon juice, ginger garlic paste, cumin powder, coriander powder, turmeric powder, garam masala, paprika, and salt. Mix well to form a marinade.", "Add chicken breast pieces to the marinade and coat thoroughly. Cover and refrigerate for at least 30 minutes.", "While the chicken marinates, cook the brown rice: rinse rice under cold water, then add to a pot with 370g of water. Add 1g of salt, bring to a boil, then reduce to a simmer, cover, and cook for 25 minutes or until water is absorbed and rice is tender.", "In a pan, heat olive oil over medium heat. Add cumin seeds, bay leaf, and sliced onion. Saut\u00e9 until onions are golden brown. Set aside.", "Preheat a grill or a grill pan over medium-high heat. Grill the marinated chicken breasts for about 6-7 minutes on each side, or until fully cooked and juices run clear.", "Mix the saut\u00e9ed onions into the cooked brown rice. Fluff with a fork and remove the bay leaf.", "Serve the grilled tandoori chicken alongside the spiced brown rice."]', 'indian', 45, NULL, 'medium', 2, '{"calories": 590.0, "protein_g": 53.0, "carbs_g": 45.0, "fat_g": 23.0, "fiber_g": 5.0}', NULL, NULL, '[-0.01679856888949871, -0.046772923320531845, -0.005409094505012035, 0.0010742946760728955, -0.038702476769685745, -0.006270202342420816, 0.06674839556217194, 0.010634263046085835, 0.008923194371163845, 0.006509863305836916, 0.004974360577762127, -0.06853191554546356, 0.03489019349217415, -0.016029423102736473, -0.01113030593842268, 0.02534833736717701, 0.015795337036252022, 0.03431054577231407, -0.03435513377189636, 0.023653989