INSERT INTO public.recipes VALUES (190, 'Italian Grilled Chicken and Pesto Pasta', 'A high-protein Italian dish featuring grilled chicken and pasta tossed in a rich pesto sauce, perfect for athletes focusing on body recomposition.', '["body_recomp"]', '["high_protein", "meal_prep_friendly", "italian"]', '["high-protein"]', '["lunch", "dinner"]', '["Preheat a grill or grill pan over medium-high heat.", "Season the chicken breast with a pinch of salt and black pepper.", "Grill the chicken breast for 5-6 minutes per side until fully cooked and grill marks appear. Let it rest for a few minutes before slicing it into strips.", "In a large pot of boiling salted water, cook the penne pasta until al dente. Drain and set aside.", "In a large skillet, heat the olive oil over medium heat. Add the cherry tomatoes and cook for 2-3 minutes until they start to soften.", "Add the cooked pasta, sliced grilled chicken, and basil pesto to the skillet. Toss everything together to coat the pasta and chicken in the pesto.", "Stir in the spinach and allow it to wilt slightly.", "Serve the pasta topped with grated parmesan cheese."]', 'italian', 45, NULL, 'medium', 1, '{"calories": 760.0, "protein_g": 55.0, "carbs_g": 76.0, "fat_g": 27.0, "fiber_g": 7.0}', NULL, NULL, '[-0.03923538699746132, -0.02295314148068428, -0.020001709461212158, -0.02330424077808857, -0.0012775365030393004, -0.056351497769355774, -0.006473400164395571, 0.0075651006773114204, -0.020188231021165848, -0.055649299174547195, 0.0315331406891346, 0.008689716458320618, 0.021691376343369484, 0.03155508264899254, 0.00017743562057148665, 0.04142976179718971, -0.020802656188607216, 0.03524162992835045, -0.03480275347828865, 0.01147657074034214, 0.04577462002635002, 0.006226533092558384, -0.029997078701853752, -0.014833960682153702, -0.03886234387755394, -0.021658461540937424, 0.016885699704289436, 0.02317257784307003, 0.028790172189474106, 0.020385723561048508, 0.03412250056862831, -0.015064369887113571, 0.008722632192075253, -